import React from 'react'
import {Icon} from "@material-ui/core";
import ArtworchBlack from '../../../logo_black.svg'

function Logo() {
    return (
        <Icon>
            <img src={ArtworchBlack} height={24} width={24}/>
        </Icon>
    )
}

export default Logo
